import React, { useState, useEffect } from "react";

import {
  Card,
  CardContent,
  CardActions,
  Button,
  Typography,
  List,
  Avatar,
} from "@mui/material";


const WeatherCard = () => {

    return (
      <div>
        <Card sx={{ minWidth: 275 }}>
          <CardContent>
            <Typography
              sx={{ fontSize: 14 }}
              color="text.secondary"
              gutterBottom
            >
              {this.state.city}
            </Typography>
            <Typography variant="h5" component="div"></Typography>
            <Typography variant="body2">{this.state.temp}</Typography>
            <img src=""></img>
          </CardContent>
        </Card>
      </div>
    );
}

export default WeatherCard;
